<script src="https://code.jquery.com/jquery-2.1.1.min.js"></script>
<script src="svglite-min.js"></script>
<script>
	svglitedefs.max = 1000;
	$(function() {
		$('#svg27178').svglite({resize:true,patterns:1500,default_opacity:0.1,change_opacity:1,});
		$('button').prop('disabled',true);
		$.ajax({
			url: 'data.json',
			success:function(data) {
				window.padata = data;
				$('button').prop('disabled',false);
			}
		});
		$('body').on('click','button',function() {
			var data = window.padata;
			if ($(this).hasClass('clear')) {
				$('path').each(function() {
					$(this).pathclass_pattern();
				});
			}
			else if ($(this).hasClass('plain')) {
				for (var i = 0; i < data.results.length; i++) {
					$('#'+data.results[i].county).pathclass_pattern(data.results[i].winner.toLowerCase());
				};
			}
			else {
				for (var i = 0; i < data.results.length; i++) {
					$('#'+data.results[i].county).pathclass_pattern(data.results[i].winner.toLowerCase()+'img');
				};	
			}
		});
	});
</script>
</body>
